  import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link, Navigate, useParams } from 'react-router-dom';

import AccountDashboard from './components/AccountDashboard';
import AccountDetails from './components/AccountDetails';
import CreateAccountForm from './components/CreateAccountForm';
import DepositForm from './components/DepositForm';
import WithdrawForm from './components/WithdrawForm';
import TransferForm from './components/TransferForm';

function App() {
  const [selectedAccountId, setSelectedAccountId] = useState(null);

  return (
    <Router>
      <div>
        <nav style={{ padding: '1rem', borderBottom: '1px solid #ccc' }}>
          <Link to="/accounts" style={{ marginRight: '1rem' }}>Accounts</Link>
          <Link to="/create" style={{ marginRight: '1rem' }}>Create Account</Link>

          {selectedAccountId && (
            <>
              <Link to={`/accounts/${selectedAccountId}/deposit`} style={{ marginRight: '1rem' }}>
                Deposit
              </Link>
              <Link to={`/accounts/${selectedAccountId}/withdraw`} style={{ marginRight: '1rem' }}>
                Withdraw
              </Link>
              <Link to={`/accounts/${selectedAccountId}/transfer`} style={{ marginRight: '1rem' }}>
                Transfer
              </Link>
            </>
          )}
        </nav>

        <Routes>
          {/* Redirect root to /accounts */}
          <Route path="/" element={<Navigate to="/accounts" replace />} />

          {/* List accounts */}
          <Route
            path="/accounts"
            element={
              <AccountDashboard
                onSelectAccount={(id) => setSelectedAccountId(id)}
                selectedAccountId={selectedAccountId}
              />
            }
          />

          {/* Account details and transaction history */}
          <Route
            path="/accounts/:accountId"
            element={<AccountDetailsWrapper />}
          />

          {/* Deposit, Withdraw, Transfer forms scoped by accountId */}
          <Route path="/accounts/:accountId/deposit" element={<DepositFormWrapper />} />
          <Route path="/accounts/:accountId/withdraw" element={<WithdrawFormWrapper />} />
          <Route path="/accounts/:accountId/transfer" element={<TransferFormWrapper />} />

          {/* Create a new account */}
          <Route path="/create" element={<CreateAccountForm />} />

          {/* Fallback route */}
          <Route path="*" element={<h2>404 - Page Not Found</h2>} />
        </Routes>
      </div>
    </Router>
  );
}

// Wrapper to extract accountId param from URL and pass to AccountDetails
function AccountDetailsWrapper() {
  const { accountId } = useParams();
  return <AccountDetails accountId={parseInt(accountId, 10)} />;
}

// Wrappers for Deposit, Withdraw, Transfer forms
function DepositFormWrapper() {
  const { accountId } = useParams();
  return <DepositForm accountId={parseInt(accountId, 10)} />;
}

function WithdrawFormWrapper() {
  const { accountId } = useParams();
  return <WithdrawForm accountId={parseInt(accountId, 10)} />;
}

function TransferFormWrapper() {
  const { accountId } = useParams();
  return <TransferForm accountId={parseInt(accountId, 10)} />;
}

export default App;
